import React from "react";

export default function Card(props){
  let badgeText
  if(props.openSpots === 0){
    badgeText = "SOLD OUT"
  } else if(props.location === "Online"){
    badgeText="ONLINE"
  }

  
  return(
    <div className="card">
      <img src={`../images/${props.img}`} className="card-image"/>
       {badgeText && <div className="sold">{badgeText}</div>}
      <div> 
        <img src="./images/star 1.png" width={14}/> {props.rating}  <span className="six">({props.reviewCount}).{props.location}</span>
      </div>
      
      <p className="life">
        {props.title}
      </p>
      <p className="lifes">
        <span className="from">From ${props.price}</span> / person
      </p>

    </div>
  )

}
